import Link from 'next/link';
import { Flex, List, ListItem } from '@chakra-ui/core';

const Nav = () => (
  <Flex>
    <List>
      <ListItem>
        <Link href="/history">
          <a>History</a>
        </Link>
      </ListItem>
      <ListItem>
        <Link href="/">
          <a>Home</a>
        </Link>
      </ListItem>
    </List>
  </Flex>
);

export default Nav;
